    private getTomorrow(): Date {
        const now = new Date();
        return new Date(now.getDay() + 1);
    }

    private getSixMonthsFromNow(): Date {
        const now = new Date();
        const sixMonthsFromNow = new Date(now.setMonth(now.getMonth() + 6));
        return sixMonthsFromNow;
    }

    private getRandomDateWithinRange(start: Date, end: Date): Date {
        const startTime = start.getTime();
        const endTime = end.getTime();
        return new Date(startTime + Math.random() * (endTime - startTime));
    }

    private getRandomDepartureAndArrivalDates(): { departure: Date, arrival: Date } {
        const sixMonthsFromNow = this.getSixMonthsFromNow();

        // Generate random departure date
        const departure = this.getRandomDateWithinRange(this.getTomorrow(), sixMonthsFromNow);

        // Generate random arrival date after departure date
        const arrival = this.getRandomDateWithinRange(departure, sixMonthsFromNow);

        return {departure, arrival};
    }

    private generateRandomDatePairs(count: number): { departure: Date, arrival: Date }[] {
        const datePairs: { departure: Date, arrival: Date }[] = [];
        for (let i = 0; i < count; i++) {
            datePairs.push(this.getRandomDepartureAndArrivalDates());
        }
        return datePairs;
    }

    private DepartureArrivalPares = this.generateRandomDatePairs(10);

