    private buildRandomApiWagonList(): WagonSearchSummary[] {
        const value: WagonSearchSummary[] = [];
        for (let i = 0; i < 10; i++) {
            const item = this.getWagonlistItenMock();
            value.push(item);
        }

        return value;
    }

    private getRandomArrayElement<T>(arr: T[]): T {
        const randomIndex = Math.floor(Math.random() * arr.length);
        return arr[randomIndex];
    }
